import TotalCalendar from '../components/CustomCalendar';
const style = `
width: 100px;
height: 100px;
border 10px solid red;
`;

export default function Schedule() {
  return (
    <main className='mw'>
      <section className='subSchedule' style={style}>
        <TotalCalendar />
      </section>
    </main>
  );
}
